import React from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Switch, Redirect } from 'react-router-dom'; // Import necessary components from 'react-router-dom'
import Header from './components/Header';
import Announcements from '../src/components/Announcements';
import Assignments from '../src/components/Assignments';
import Resources from '../src/components/Resources';
import Footer from '../src/components/Footer';
import NavTabs from './components/navTabs'; // Correct the import here

function App() {
  return (
    <div className="App">
      <Header />
      <NavTabs />
      <main>
        <Router>
          <Switch>
            <Route path="/Kinder" component={Announcements} />
            <Route path="/1st" component={Assignments} />
            <Route path="/2nd" component={Resources} />
            {/* Add more Route components for other pages */}
            <Redirect to="/Kinder" />
          </Switch>
        </Router>
      </main>
      <Footer />
    </div>
  );
}

export default App;
